var $bm_rt;
var coef, x, y, z;
try {
    coef = 166.67;
    var per = div(thisComp.layer('GHS [Controller]').effect('Font Controller')('Tracking center'), 100 / 2);
    x = sum(value[0], mul(thisComp.layer('GHS [Controller]').effect('Font Controller')('Tracking'), sub(2, per)));
    $bm_rt = y = sum(sum(value[1], mul(div(mul(thisComp.layer('GHS [Controller]').effect('Font Controller')('Line spacing'), 100), coef), 0)), mul(thisComp.layer('GHS [Controller]').effect('Font Controller')('Y-Offset'), 2));
    if (thisLayer.position.value.length > 2) {
        z = sum(value[2], mul(thisComp.layer('GHS [Controller]').effect('Font Controller')('Z-Offset'), 2));
        $bm_rt = [
            x,
            y,
            z
        ];
    } else {
        $bm_rt = [
            x,
            y
        ];
    }
} catch (e) {
    $bm_rt = value;
}

